import React from "react";
import { TextInput, StyleSheet } from "react-native";

const Input = (props) => {
  return <TextInput style={{ ...styles.input, ...props.style }}></TextInput>;
};

const styles = StyleSheet.create({
  input: {
    height: 30,
    borderBottomColor: "grey",
    borderBottomWidth: 1,
    borderRadius: 10,
  },
});

export default Input;
